import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import EventList from './components/EventList';
import CreateEvent from './components/CreateEvent';
import EditEvent from './components/EditEvent';
import DeleteEvent from './components/DeleteEvent';
import EventDetails from './components/EventDetail'; // Ensure this is used if imported
import EventDetail from './components/EventDetail';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="" element={<EventList />} />
        <Route path="/create-event" element={<CreateEvent />} />
        <Route path="/edit-event/:id" element={<EditEvent />} />
        <Route path="/delete-event/:id" element={<DeleteEvent />} />
        <Route path="/event-details/:id" element={<EventDetails />} /> {/* Make sure you're using this */}
        <Route path="/events/:id" element={<EventDetails />} /> {/* Dynamic route */}
        <Route path="/events/:id" element={<EventDetail />} />
      </Routes>
    </Router>
  );
}

export default App;
